PROBLEM: 'A unit of blood expires after '$10!=10\cdot 9 \cdot 8 \cdots 1$' seconds. Yasin donates a unit of blood at noon of January 1. On what day does his unit of blood expire?\n'
=======
CHOICES:
[A]: \text{January 2}
[B]: \text{January 12}
[C]: \text{January 22}
[D]: \text{February 11}
[E]: \text{February 12}

PROBLEM: 'A number '$m$' is randomly selected from the set '$\{11,13,15,17,19\}$', and a number '$n$' is randomly selected from '$\{1999,2000,2001,\ldots,2018\}$'. What is the probability that '$m^n$' has a units digit of '$1$'?\n'
=======
CHOICES:
[A]: \frac{1}{5}
[B]: \frac{1}{4}
[C]: \frac{3}{10}
[D]: \frac{7}{20}
[E]: \frac{2}{5}

PROBLEM: 'A scanning code consists of a '$7 \times 7$' grid of squares, with some of its squares colored black and the rest colored white. There must be at least one square of each color in this grid of '$49$' squares. A scanning code is called '$\textit{symmetric}$' if its look does not change when the entire square is rotated by a multiple of '$90 ^{\circ}$' counterclockwise around its center, nor when it is reflected across a line joining opposite corners or a line joining midpoints of opposite sides. What is the total number of possible symmetric scanning codes?\n'
=======
CHOICES:
[A]: \text{ 510}
[B]: \text{ 1022}
[C]: \text{ 8190}
[D]: \text{ 8192}
[E]: \text{ 65,534}

PROBLEM: 'Let '$a, b, c,$' and '$d$' be positive integers such that '$\gcd(a, b)=24$', '$\gcd(b, c)=36$', '$\gcd(c, d)=54$', and '$70<\gcd(d, a)<100$'. Which of the following must be a divisor of '$a$'?\n'
